import React from 'react'
import styled from 'styled-components';

const Row =styled.div`
width: 60px;
height: 60px;
//margin:20px auto;
background-color: #FEDE17;
white-space    : nowrap;
outline        : none;
border         : none;
cursor         : pointer;
text-decoration: none;
transition     : 0.3s;
//display        : flex;
justify-content: center;
align-items    : center;
/* padding        : ${({big}) => (big ? '16px 40px' : '14px 24px')}; */
color          : ${({primary}) => (primary ?'#fff': '#000d1a')};
font-size      : ${({big}) => (big ? '20px' : '14px')};
&:hover{
    transform: translateY(2px);
}
`;
const Sd1=styled.div`
width: 100%;
height: 10px;
position: relative;
background-color: #FEDE17;
//margin-bottom: 170px;

&::before , ::after{
    position: absolute;
    content: '';
    width: 100%;
    height: 90%;
    top: 50px;
    left: 0;
    background-color: #FEDE17;
    transform: skewY(20deg);
    z-index: -1;
}
&::after{
    transform: skewY(-20deg);
}
`;

const HighLigtedButton = () => {
    return (
        <Row>
            <h1>Grab Deals</h1>
            <Sd1>

            </Sd1>
        </Row>
    )
}

export default HighLigtedButton
